import React,{Component } from 'react';

class Sidebar extends Component{
  constructor(){
      super();
      this.state ={
        error: null,
        isLoaded: false,
        items: []
      }
  }
  componentDidMount(){
    fetch("https://api.spaceXdata.com/v3/launches?limit=100")
    .then(res => res.json())
    .then(
      (result) => {
        this.setState({
          isLoaded: true,
          items: result
        });
      },
      (error) => {
        this.setState({
          isLoaded: true,
          error
        });
      }
    )
  }
  render(){
    return(
    <div className="sidebar">
           <div className="main-2">
               {
                   [0,1,2,3,4,5,6].map(row => (
                       <div className></div>
                   ))
               }
               <div>
                   <button name="b1" value="2006" >2006</button>
               </div>
            </div>
       </div>
       );
  }
}

